    console.log(PokemonDetails?.happiness)


    return ( 
        <div>
            <div className='name'>{PokemonDetails?.name}<GrFavorite /></div>
            <div className='height'>Height: {PokemonDetails?.height}</div>
            <div className='weight'>Weight: {PokemonDetails?.weight}</div>
            <div className='weight'>Base Happiness: {PokemonDetails?.happiness }</div>

            <div className='description '>Description: {PokemonDetails?.description}</div>

        </div>
     );
}
